Le sanctuaire de faune de Thung Yai (en thaï : เขตรักษาพันธุ์สัตว์ป่าทุ่งใหญ่นเรศวร, thung yai signifiant « plaines ») est une région protégée de la Thaïlande. Située au nord de la province de Kanchanaburi et au sud de la province de Tak. Créé en 1974, il est aussi déclaré patrimoine mondial de l'humanité par l'UNESCO en 1991 en même temps que le sanctuaire de faune de Huai Kha Khaeng voisin en raison de la biodiversité. Thung Yai a alors une superficie de 3647 km2 (364 700 ha soit 2 279 500 rai) : 
* Il y a Thung Yai Ouest (2130 km2 soit 213 000 ha ; 1 331 062 rai) dans lequel on dénombre 69 espèces de mammifères, 308 espèces d'oiseaux, 19 espèces de reptiles et 15 espèces d'amphibiens ; 
* et il y a Thung Yai Est (1517,5 km2 soit 151 750 ha ; 948 438 rai) dans lequel on compte 82 espèces de mammifères, 314 espèces d'oiseaux, 74 espèces de reptiles et 45 espèces d'amphibiens. Huai Kha Khaeng a une superficie de 2575 km2 (257 464 ha soit 1 609 150 rai) depuis 1986 et dès 1993 une superficie 2780 km2 (278 000 ha soit 1 737 587 rai) et on y trouve 85 espèces de mammifères, 472 espèces d'oiseaux, 104 espèces de reptiles et 49 espèces d'amphibiens. Les sanctuaires de faune de Thung Yai-Huai Kha Khaeng forment la région protégée la plus grande de l'Asie du Sud-Est continentale, couvrant ainsi environ 6427 km2 soit 642 700 hectares ou 4 017 087 rai (avec la réserve de la forêt de la rivière Nam Choan de 447 km2 soit 44 720 ha). Ce sont des sanctuaires difficiles d'accès et bien préservés, constitués d'un grand nombre de vallées et de petites plaines dont le fond se situe entre 250 et 400 m au-dessus de la mer et de près de 80 pics culminant à plus de 1000 m d'altitude dont le Khao Thai Par peak à 1811 m dans le sanctuaire de Thung Yai et le Khao Pai peak à 1678 m dans le sanctuaire de Huai Kha Khaeng. Ces deux sanctuaires de faune englobent deux systèmes fluviaux importants, le haut Khwae Yai et le Khakhaeng Huai. La faune des sanctuaires de Thung Yai-Huai Kha Kaeng compte environ 120 espèces de mammifères, 400 espèces d'oiseaux, 96 espèces de reptiles, 43 espèces d'amphibiens, et 113 espèces de poissons d'eau douce. Il y a probablement plus d'espèces encore, mais non recensées.
